export default (function(a,b,c,d,e){return {data:{okEZgVSf9N:{data:{id:1634,attributes:{imdbId:"tt0110148",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYThmYjJhMGItNjlmOC00ZDRiLWEzNjUtZjU4MjA3MzY0MzFmXkEyXkFqcGdeQXVyNTI4MjkwNjA@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"},{Source:"Rotten Tomatoes",Value:"64%"},{Source:"Metacritic",Value:"59\u002F100"}],item_lang:{data:{id:2297,attributes:{title:"Interview with the Vampire: The Vampire Chronicles",plot:"Against the backdrop of a gloomy San Francisco, the nearly two-century-old vampire, Louis de Pointe du Lac, recounts the unbelievable story of his eternal transformation and a life worse than death to the sceptic reporter, Daniel Molloy. Spanning two hundred years of cruel betrayals, extreme solitude, and unquenched thirst, Louis' grimly fascinating tale pivots around his perpetually regrettable decision to embrace the dictatorship of blood, and, above all, his maker: the seductive blonde aristocrat of death, Lestat de Lioncourt. Is Louis' mystical epic of bloodshed genuine? Is this, indeed, an interview with a vampire?",slug:"interview-with-the-vampire-the-vampire-chronicles"}}},books:{data:[{id:8473,attributes:{title:d,description:"International standard book number used for this book also used for earlier editions.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=skFaAAAAYAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2004-01-01",publisher:b,subtitle:b}},{id:8474,attributes:{title:"Interview with the Vampire: Claudia's Story",description:"A richly-illustrated graphic novel adaptation of Anne Rice's Interview with the Vampire, told through the eyes of the vampire Claudia, who was just a little girl when she was turned by the vampire Lestat. Though she spends many years of happiness with her two vampire fathers, she gradually grows discontent with their insistence upon treating her like a little girl, even though she has lived as long as any mortal man...and her lust to kill is certainly no less than theirs...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p42RtwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2012-11-20",publisher:"Yen Press",subtitle:b}},{id:8475,attributes:{title:"The Vampire Chronicles Collection",description:"The hypnotic, deeply seductive novels of Anne Rice have captivated millions of fans around the world. It all began a quarter of a century ago with Interview with the Vampire. Now, in one chilling volume, here are the first three classic novels of The Vampire Chronicles. INTERVIEW WITH THE VAMPIRE Witness the confessions of a vampire. A novel of mesmerizing beauty and astonishing force, it is a story of danger and flight, love and loss, suspense and resolution, and the extraordinary power of the senses. “A magnificent, compulsively readable thriller . . . Anne Rice begins where Bram Stoker and the Hollywood versions leave off and penetrates directly to the true fascination of the myth–the education of the vampire.” –Chicago Tribune THE VAMPIRE LESTAT Once an aristocrat from pre-revolutionary France, now a rock star in the decadent 1980s, Lestat rushes through the centuries seeking to fathom the mystery of his existence. His is a mesmerizing story–passionate and thrilling. “Frightening, sensual . . . A psychological, mythological sojourn . . . Anne Rice will live on through the ages of literature. . . . To read her is to become giddy as if spinning through the mind of time.” –San Francisco Chronicle QUEEN OF THE DAMNED Akasha, the queen of the damned, has risen from a six-thousand-year sleep to let loose the powers of the night. She has a marvelously devious plan to “save” mankind–in this vivid novel of the erotic, electrifying world of the undead. “With The Queen of the Damned, Anne Rice has created universes within universes, traveling back in time as far as ancient, pre-pyramidic Egypt and journeying from the frozen mountain peaks of Nepal to the crowded, sweating streets of southern Florida.” –Los Angeles Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4Ley0jjlZ-4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2011-05-25",publisher:e,subtitle:"Interview with the Vampire, The Vampire Lestat, The Queen of the Damned"}},{id:8476,attributes:{title:d,description:"The spellbinding classic that started it all from the #1 New York Times bestselling author “A magnificent, compulsively readable thriller . . . Rice begins where Bram Stoker and the Hollywood versions leave off and penetrates directly to the true fascination of the myth—the education of the vampire.”—Chicago Tribune Here are the confessions of a vampire. Hypnotic, shocking, and chillingly sensual, this is a novel of mesmerizing beauty and astonishing force—a story of danger and flight, of love and loss, of suspense and resolution, and of the extraordinary power of the senses. It is a novel only Anne Rice could write.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MbW3_eSDGl4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2010-11-17",publisher:e,subtitle:b}},{id:8477,attributes:{title:"The Vampire Lestat",description:"Lestat has risen from his long sleep as a modern day rock star, and makes public his story of boyhood in eighteenth-century France and initiation into vampiredom in order to solve the mystery of his existence",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=038aAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"1985-01-01",publisher:"Alfred a Knopf Incorporated",subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940966720}}("Anne Rice","",null,"Interview with the Vampire","Ballantine Books"))